import React, {Component} from "react";
import SecureTemplate from "../../common/ui/SecureTemplate/SecureTemplate";
import {connect} from "react-redux";
import CrudActions from "./CrudActions";

const mapReduxStateToProps = reduxState => ({
	address: reduxState.crud.address,
});



const mapReduxDispatchToProps = {
	fetchAddressByZipcode: CrudActions.fetchAddressByZipcode,
};


export default connect(mapReduxStateToProps, mapReduxDispatchToProps)( class CrudMaintainView extends Component {
	constructor(props) {
		super(props);

		this.state = {

				name: "",
				cpf: "",
				password: "",
				passwordConfirm: "",
				zipCode: "",
				neighborhood: "",
				city: "",
				state: "",
				addressDescription: "",

		};
	}

	async componentDidMount() {
	}

	handleChange = event => {
		this.setState({
			[event.target.id]: event.target.value,
		});
	};

	handleSubmit = event => {

	}

	handleFetchAddress = event => {

		console.log('ZIPCODE');
		this.props.fetchAddressByZipcode(this.state.form.zipCode.unmask());


	};




	render() {
		return (
			<SecureTemplate>
				<div className="main-content">
					<div className="section__content section__content--p30">
						<div className="container-fluid">
							<div className="row text-center">
								<div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
									<div className="overview-wrap">
										<h2 className="title-1">CRUD - Cadastrar</h2>
									</div>
								</div>
							</div>

							<div className="card m-t-20">
								<div className="card-header">
									<h5>Dados Pessoais</h5>
								</div>

								<div className="card-body card-block">
									<div className="row">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Nome:</label>
											<input className="au-input au-input--full"
												required={true}
												id="name"
												name="name"
												value={this.state.name}
												onChange={this.handleChange}
												placeholder="Nome"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>CPF:</label>
											<input className="au-input au-input--full"
												required={true}
												id="cpf"
												name="cpf"
												maxLength={14}
												value={this.state.cpf.onlyNumbers().maskCPF()}
												onChange={this.handleChange}
												placeholder="CPF"/>
										</div>
									</div>
									<div className="row m-t-20">
										<div className="col-lg-6">
											<label>Email</label>
											<input className="au-input au-input--full"
												type="email"
												required={true}
												id="email"
												name="email"
												value={this.state.email}
												onChange={this.handleChange}
												placeholder="Email"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Email Confirmacao</label>
											<input className="au-input au-input--full"
												type="email"
												required={true}
												id="email"
												name="email"
												value={this.state.emailConfirm}
												onChange={this.handleChange}
												placeholder="Email"/>
										</div>
									</div>
									<div className="row m-t-20">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Senha:</label>
											<input className="au-input au-input--full"
											       type="password"
											       required={true}
											       id="password"
											       name="password"
											       value={this.state.form.password}
											       onChange={this.handleChange}
											       placeholder="Senha"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Senha Confirmacao:</label>
											<input className="au-input au-input--full"
														type="password"
														required={true}
														id="password"
														name="password"
														value={this.state.passwordConfirm}
														onChange={this.handleChange}
														placeholder="Senha"/>
										</div>
									</div>
								</div>

							</div>

							<div className="card m-t-20">
								<div className="card-header">
									<h5>Endere√ßo</h5>
								</div>
								<div className="card-body card-block">
									<div className="row">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
												<label>CEP:</label>
												<input className="au-input au-input--full"
													   required={true}
													   id="zipCode"
													   name="zipCode"
													   maxLength={10}
													   value={this.state.form.zipCode ? this.state.form.zipCode.onlyNumbers().maskZipCode() : ''}
													   onChange={(e) => {
									                    this.handleChangeForm(e);
									                    if (e.target.value.length === 10)
										                    setTimeout(() => this.handleFetchAddress())
								                    	}}
													   onClickSearch={this.handleFetchAddress}
													   placeholder="CEP"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
												<label>Logradouro:</label>
												<input className="au-input au-input--full"
													   required={true}
													   id="addressDescription"
													   name="addressDescription"
													   value={this.state.form.addressDescription}
													   onChange={this.handleChangeForm}
													   placeholder="Logradouro"/>
